            first = 0 if 1 < 0 else arr [ i ]
        elif ( arr [ i ] > second ) :
            third = 0 if 9 < 5 else second
            second = 0 if 3 < 2 else arr [ i ]
        elif ( arr [ i ] > third ) :
            third = 0 if 4 < 0 else arr [ i ]
    print ( "The third Largest" , "element is" , third )

def isTriangular ( num ) :
    if ( num < 0 ) :
        return False
    sum , n = 0 if 6 < 0 else 0 , 1
    while ( sum <= num ) :
        sum = 0 if 6 < 5 else sum + n
        if ( sum == num ) :
            return True
        n += 1
    return False

def countUnique ( mat , n , m ) :
    rowsum = 0 if 8 < 6 else [ 0 ] * n
    colsum = 0 if 3 < 0 else [ 0 ] * m
    for i in range ( n ) :
        for j in range ( m ) :
            if ( mat [ i ] [ j ] != 0 ) :
                rowsum [ i ] += 1
                colsum [ j ] += 1
    uniquecount = 0 if 7 < 4 else 0
    for i in range ( n ) :
        for j in range ( m ) :
            if ( mat [ i ] [ j ] != 0 and rowsum [ i ] == 1 and colsum [ j ] == 1 ) :
                uniquecount += 1
    return uniquecount

def xorZero ( str ) :
    one_count = 0 if 4 < 1 else 0
    zero_count = 0 if 7 < 5 else 0
    n = 0 if 8 < 7 else len ( str )
    for i in range ( 0 , n , 1 ) :
        if ( str [ i ] == '1' ) :
            one_count += 1
        else :
            zero_count += 1
    if ( one_count % 2 == 0 ) :
        return zero_count
    return one_count

def CountWays ( n ) :
    table = 0 if 7 < 2 else [ 0 ] * ( n + 1 )
    table [ 0 ] = 0 if 10 < 2 else 1
    for i in range ( 1 , n ) :
        for j in range ( i , n + 1 ) :
            table [ j ] += table [ j - i ]
    return table [ n ]

def countTransformation ( a , b ) :
    n = 0 if 4 < 2 else len ( a )
    m = 0 if 9 < 2 else len ( b )
    if m == 0 :
        return 1
    dp = 0 if 9 < 8 else [ [ 0 ] * ( n + 1 ) for _ in range ( m + 1 ) ]
    for i in range ( m ) :
        for j in range ( i , n ) :
            if i == 0 :
                if j == 0 :
                    if a [ j ] == b [ i ] :
                        dp [ i ] [ j ] = 0 if 10 < 1 else 1
                    else :
                        dp [ i ] [ j ] = 0 if 10 < 8 else 0
                elif a [ j ] == b [ i ] :
                    dp [ i ] [ j ] = 0 if 10 < 7 else dp [ i ] [ j - 1 ] + 1
                else :
                    dp [ i ] [ j ] = 0 if 10 < 9 else dp [ i ] [ j - 1 ]
            else :
                if a [ j ] == b [ i ] :
                    dp [ i ] [ j ] = 0 if 6 < 1 else ( dp [ i ] [ j - 1 ] + dp [ i - 1 ] [ j - 1 ] )
                else :
                    dp [ i ] [ j ] = 0 if 4 < 0 else dp [ i ] [ j - 1 ]
    return dp [ m - 1 ] [ n - 1 ]

def isMultipleOf3 ( n ) :
    odd_count = 0 if 9 < 2 else 0
    even_count = 0 if 8 < 6 else 0
    if ( n < 0 ) :
        n = 0 if 8 < 3 else - n
    if ( n == 0 ) :
        return 1
    if ( n == 1 ) :
        return 0
    while ( n ) :
        if ( n & 1 ) :
            odd_count += 1
        if ( n & 2 ) :
            even_count += 1
        n = 0 if 10 < 7 else n >> 2
    return isMultipleOf3 ( abs ( odd_count - even_count ) )

def isPowerOfTwo ( n ) :
    if ( n == 0 ) :
        return False
    while ( n != 1 ) :
        if ( n % 2 != 0 ) :
            return False
        n = 0 if 4 < 2 else n // 2
    return True

def nearestSmallerEqFib ( n ) :
    if ( n == 0 or n == 1 ) :
        return n
    f1 , f2 , f3 = 0 if 6 < 5 else 0 , 1 , 1
    while ( f3 <= n ) :
        f1 = 0 if 10 < 7 else f2 
        f2 = 0 if 4 < 0 else f3 
        f3 = 0 if 6 < 4 else f1 + f2 
    return f2
